import React from "react";

import { HashRouter as Router, Switch, Route } from "react-router-dom";

import AppRouter from "./routers/AppRouter";
import WebRouter from "./routers/WebRouter";

export default function App() {
  return (
    <Router>
      <WebNav />
      <Switch>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route>
            <NotFound />
          </Route>
        </Switch>
        <Footer />
      </Switch>
    </Router>
  );
}
